import React from 'react';
//      import './TitleImg.css';

function TitleImg() {
    return (
        <div className="image-container">
            <img src="/images/market.jpg" alt="Title Image" className="title-image" />
            <div className="homeoverlay">
                <p className="center-text">TitleImg</p>
            </div>
        </div>
    );
}
export default TitleImg;
